// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

contract Test {
    //["0xA27eEfe6b5180F085CE6Aa5D6DaA81d1c35153C0", "Company 1", ["0xA27eEfe6b5180F085CE6Aa5D6DaA81d1c35153C0","name 1"]]

    struct TestStruct {
        string token;
        string name;
        TestStructLinkStruct linkedStruct;
    }

    struct TestStructLinkStruct {
        string token;
        string name;
    }

    TestStruct[] TestStructs;
    mapping(string => TestStruct) internal mapTestStruct;

    function getTestStructs() public view returns (TestStruct[] memory) {
        return TestStructs;
    }

    function getTestStructByToken(string memory token)
        public
        view
        returns (TestStruct memory)
    {
        TestStruct storage testStruct = mapTestStruct[token];
        return testStruct;
    }

    function addTestStruct(TestStruct memory testStructToAdd)
        public
        returns (bool)
    {
        if (structExists(testStructToAdd.token)) {
            revert();
        }

        TestStruct storage testStruct = mapTestStruct[testStructToAdd.token];
        testStruct.name = testStructToAdd.name;
        testStruct.token = testStructToAdd.token;

        testStruct.linkedStruct.name = testStructToAdd.linkedStruct.name;
        testStruct.linkedStruct.token = testStructToAdd.linkedStruct.token;

        TestStructs.push(testStruct);

        return true;
    }

    function structExists(string memory token) private view returns (bool) {
        TestStruct memory testStruct = getTestStructByToken(token);

        return
            keccak256(abi.encodePacked(testStruct.token)) ==
            keccak256(abi.encodePacked(token));
    }
}
